function PictureCard() {
    return (
      <div className="flex self-center h-[600px] w-[600px] mx-auto rounded-full">
        <img
          src="/images/expanded-image.png"
          alt="Jake Sussner Profile"
          className="w-80 h-80 rounded-full object-cover object-bottom"
        />
      </div>
    );
}

export default PictureCard;
